        public DTO.Membro MembroPorCpf(string CPF)
        {
            var membro = new DTO.Membro();

            sql_AcessoBancoDados.LimparParametros();
            sql_AcessoBancoDados.AdicionarParametro("varCPF", CPF);

            DataTable dataTable = sql_AcessoBancoDados.Consultar(CommandType.StoredProcedure, "MembroPorCpf");

            foreach (DataRow dataRow in dataTable.Rows)
            {                
                membro.CPF = Convert.ToString(dataRow["CPF"]);
                membro.CPFbanco = Convert.ToString(dataRow["CPF"]);
                membro.Nome = Convert.ToString(dataRow["Nome"]);
                membro.Apelido = Convert.ToString(dataRow["Apelido"]);

                // VERIFICA E PREENCHE DATA PACH
                var txtPatch = Convert.ToString(dataRow["Patch"]);
                if (txtPatch == "" || txtPatch == "N/A" || txtPatch == "//")
                {
                    membro.Patch = Convert.ToString(dataRow["Patch"]);
                }
                else
                {
                    membro.Patch = txtPatch.Substring(0, 10);
                }

                // VERIFICA E PREENCHE DATA BRASÃO
                var txtBrasao = Convert.ToString(dataRow["Brasao"]);
                if (txtBrasao == "" || txtBrasao == "N/A" || txtBrasao == "//")
                {
                    membro.Brasao = Convert.ToString(dataRow["Brasao"]);
                }
                else
                {
                    membro.Brasao = txtBrasao.Substring(0, 10);
                }

                // VERIFICA E PREENCHE DATA NASCIMENTO
                var txtNascimento = Convert.ToString(dataRow["Nascimento"]);
                if (txtNascimento == "" || txtNascimento == "N/A" || txtNascimento == "//")
                {
                    membro.Nascimento = Convert.ToString(dataRow["Nascimento"]);
                }
                else
                {
                    membro.Nascimento = txtNascimento.Substring(0, 10);
                }

                membro.Carteirinha = Convert.ToString(dataRow["Carteirinha"]);
                membro.Endereco = Convert.ToString(dataRow["Endereco"]);
                membro.CEP = Convert.ToString(dataRow["CEP"]);
                membro.Bairro = Convert.ToString(dataRow["Bairro"]);
                membro.Cidade = Convert.ToString(dataRow["Cidade"]);
                membro.Sangue = Convert.ToString(dataRow["Sangue"]);
                membro.Email = Convert.ToString(dataRow["Email"]);
                membro.Telefone = Convert.ToString(dataRow["Telefone"]);
                membro.Unidade = Convert.ToString(dataRow["Unidade"]);
                membro.Estatus = Convert.ToString(dataRow["Estatus"]);
                membro.Anotacao = Convert.ToString(dataRow["Anotacao"]);

                // VERIFICA SE FOTO BYTE ESTÁ NULL
                // RECEBE IMAGEM EM BYTE DO BANCO E DEVOLE BASE64 
                if (dataRow["FotoByte"] != System.DBNull.Value)
                {
                    membro.FotoByte = (byte[])(dataRow["FotoByte"]);
                    membro.base64imagem = Encoding.UTF8.GetString(membro.FotoByte);
                }
                else
                {
                    membro.base64imagem = "data:image/png;base64,";
                }
                
            }

            return membro;
        }
        public string CpfExistente (string CPF) 
        {
            string retorno = "";
            sql_AcessoBancoDados.LimparParametros();
            sql_AcessoBancoDados.AdicionarParametro("varCPF", CPF);

            DataTable dataTable = sql_AcessoBancoDados.Consultar(CommandType.StoredProcedure, "MembroCpfExistente");

            foreach (DataRow dataRow in dataTable.Rows)
            {
                retorno = Convert.ToString(dataRow["CPF"]);
            }

            return retorno;
        }
